import React from 'react';
import HeaderContainer from '../containers/common/HeaerContainer';
import PostListContainer from '../containers/posts/PostListContainer';
import TopSpace from '../components/common/TopSpace';
import styled from 'styled-components';
import BottomInfo from '../components/common/BottomInfo';
import PaginationContainer from '../containers/posts/PaginationContainer';
import SideDrawer from '../components/common/SideDrawer';
import BackgroundBlinder from '../components/common/BackgroundBlinder';

const Spacer = styled.div`
  height: 2rem;
`;

const PostListPage = () => {
  return (
    <div>
      <HeaderContainer />
      <SideDrawer />
      <BackgroundBlinder />
      <Spacer />
      <TopSpace title="대회 목록" description="대회 목록입니다." />
      <PostListContainer />
      <PaginationContainer />
      <BottomInfo />
    </div>
  );
};

export default PostListPage;
